window.bookSummaryJSON = "<p><b>\"It isn’t easy to write a protagonist that blends the best qualities of Anita Blake and Stephanie Plum, but Kim Harrison carries it off with style. This is a fun book! Read it!\" (Jim Butcher, number one </b><b><i>New York Times</i></b><b> best-selling author)</b></p> <p><b>In the Hollows, the vampires come out to play...and it’s always witching hour.</b></p> <p><b>The first book in number one </b><b><i>New York Times</i></b><b> best-selling author Kim Harrison’s Hollows series!</b></p> <p>All the creatures of the night gather in \"the Hollows\" of Cincinnati, to hide, to prowl, to party...and to feed.</p> <p>Vampires rule the darkness in a predator-eat-predator world rife with dangers beyond imagining - and it’s Rachel Morgan’s job to keep that world civilized.</p> <p>A bounty hunter and a witch with serious sex appeal and an attitude, she’ll bring ’em back alive, dead...or undead.</p>"; 
